DielectricRho sample_light_medium_dielectric_GGX(float wo_dot_normal, float roughness, float ior_i_over_o) {
    // ior_i_over_o is below 1 when transitioning from a higher density medium to a lighter density one.
    float ior_i_over_o_t = (ior_i_over_o - 0.331492f) / 0.457982f; // Remap valid ior_i_over_o values from [0.331492, 0.789474] to [0, 1]
    Math::Vector2f rho = Math::ImageSampling::trilinear(dielectric_GGX_into_light_medium,
        dielectric_GGX_angle_sample_count, dielectric_GGX_roughness_sample_count, dielectric_GGX_ior_i_over_o_sample_count,
        wo_dot_normal, roughness, ior_i_over_o_t);
    return { rho.x, rho.y };
}

DielectricRho sample_dense_medium_dielectric_GGX(float wo_dot_normal, float roughness, float ior_i_over_o) {
    // ior_i_over_o is above 1 when transitioning from a lower density medium to a higher density one.
    float ior_i_over_o_t = (ior_i_over_o - 1.26667f) / 1.75f; // Remap valid ior_i_over_o values from [1.26667, 3.01667] to [0, 1]
    Math::Vector2f rho = Math::ImageSampling::trilinear(dielectric_GGX_into_dense_medium,
        dielectric_GGX_angle_sample_count, dielectric_GGX_roughness_sample_count, dielectric_GGX_ior_i_over_o_sample_count,
        wo_dot_normal, roughness, ior_i_over_o_t);
    return { rho.x, rho.y };
}

DielectricRho sample_dielectric_GGX(float wo_dot_normal, float roughness, float ior_i_over_o) {
   if (ior_i_over_o < 1.0f)
       return sample_light_medium_dielectric_GGX(wo_dot_normal, roughness, ior_i_over_o);
   else
       return sample_dense_medium_dielectric_GGX(wo_dot_normal, roughness, ior_i_over_o);
}
